import React from "react";
import defaultImg from "../../img/default_user.png"
const ChatUserIcon = (props) => {
    return (
        <div className="user_img, flex-box">
            <img src={defaultImg} alt="user_img"/>
        </div>
    );
}

export default ChatUserIcon
